"271977":{"id":"271977","name":"Courtois, O Retorno do Número 1","slug":"courtois-o-retorno-do-numero-1","original_title":"Courtois, La vuelta del número 1","overview":"Um retrato do esforço impressionante de Thibaut Courtois para voltar à fase decisiva da temporada após uma grave lesão antes da La Liga. Acompanhe a incerteza da cirurgia, o sacrifício para recuperar a forma, seu dia a dia com Mishel, filhos e família, sua agenda intensa como empresário e outras facetas até então desconhecidas. Um olhar sobre os momentos importantes de uma carreira de sucesso.","first_air_date":"2024-09-20","episode_run_time":0,"vote_average":7.9,"number_of_seasons":1,"number_of_episodes":4,"created_by":[],"production_companies":["WAKAI Media"],"genres":["Documentário"],"certification":"12","backdrop_path":"https://image.tmdb.org/t/p/original/vyd0JBMVv8wmJKbfF1ELG35VWcj.jpg","poster_path":"https://image.tmdb.org/t/p/original/9AJK8pdTc2g8h21P8I7mvyLBKcx.jpg","cast":["Thibaut Courtois"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/9AJK8pdTc2g8h21P8I7mvyLBKcx.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/9AJK8pdTc2g8h21P8I7mvyLBKcx.jpg","air_date":"2024-09-20","episode_count":4,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"Dia zero","overview":"A temporada começa com uma grave lesão de Thibaut Courtois. Acompanhamos o processo de recuperação e a dedicação para voltar a ser o número 1. Além disso, viajamos às suas origens para entender como ele construiu essa personalidade disciplinada e vencedora que o acompanha desde o início. Uma jornada surpreendente que o fez estrear pelo Genk na primeira divisão belga com apenas 16 anos.","air_date":"2024-09-20","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/kf1g7BmKAqp5xV74KhvjE80ZXD8.jpg","vote_average":0},"2":{"name":"O gigante está a caminho","overview":"Enquanto ele se recupera, descobrimos aspectos até então desconhecidos de sua vida pessoal e profissional longe dos gramados. Ao mesmo tempo, analisamos a trajetória esportiva de Courtois no Atlético de Madrid e no Chelsea até sua chegada ao Real Madrid em 2018, uma contratação que mudaria tudo.","air_date":"2024-09-20","runtime":40,"still_path":"https://image.tmdb.org/t/p/original/cUpiBtLV09US9qQy1vXEZdTH0yT.jpg","vote_average":0},"3":{"name":"O vento sopra mais forte no topo","overview":"Na reta final de sua recuperação, uma segunda lesão frustra todos os planos. O nascimento de sua filha traz alegria em um momento difícil. Vamos conhecer a história de amor com Mishel Gerzig, que foi seu grande suporte durante um ano tão desafiador. A luta e a superação para voltar ainda melhor se concretizam com um retorno aos gramados quase nove meses depois, com uma estreia memorável.","air_date":"2024-09-20","runtime":36,"still_path":"https://image.tmdb.org/t/p/original/bKfnyumjrrg2Q0KDpFgWGZLL6Ar.jpg","vote_average":0},"4":{"name":"A grande final","overview":"Thibaut Courtois celebra seus 32 anos em um fim de semana repleto de emoções e surpresas. O Real Madrid garante vaga na final da Champions. No horizonte, o grande sonho de ser campeão mais uma vez e provar que o número 1 está de volta: Thibaut Courtois.","air_date":"2024-09-20","runtime":40,"still_path":"https://image.tmdb.org/t/p/original/iHrj0rFq3LPABH12Pg3yUzU5nvs.jpg","vote_average":0}}}}},
