"93454":{"id":"93454","name":"O Paraíso e a Serpente","slug":"o-paraiso-e-a-serpente","original_title":"The Serpent","overview":"Charles Sobrhaj (Tahar Rahim) é um dos criminosos mais detestáveis do século XX. Ele foi o principal suspeito dos assassinatos não resolvidos de até 20 jovens viajantes na Índia, Tailândia e 'Hippie Trail' do Nepal em 1975 e 1976. Psicopata, vigarista, ladrão e mestre do disfarce, tendo escapado repetidamente do alcance das autoridades em todo o mundo. Em 1976, o serial killer Sobhraj era o homem mais procurado da Interpol e tinha mandados de prisão em três continentes diferentes. - Série original Netflix de oito episódios.","first_air_date":"2021-01-01","episode_run_time":58,"vote_average":7.48,"number_of_seasons":1,"number_of_episodes":8,"created_by":["Toby Finlay","Richard Warlow"],"production_companies":["Mammoth Screen"],"genres":["Drama","Crime"],"certification":"N/A","backdrop_path":"https://image.tmdb.org/t/p/original/8OkqqkXS9PraWOYWLOrObfZEzC.jpg","poster_path":"https://image.tmdb.org/t/p/original/vbaen62LtRtEmrQjE7EkZ1pnQyI.jpg","cast":["Tahar Rahim","Jenna Coleman","Ellie Bamber","Billy Howle","Mathilde Warnier"],"trailer":"cOHUd4cYp4g","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/vXuQOGZtmbzuHoWdPKoukb2SWms.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/vXuQOGZtmbzuHoWdPKoukb2SWms.jpg","air_date":"2021-01-01","episode_count":8,"overview":"N/A","vote_average":7.9,"episodes":{"1":{"name":"Episódio 1","overview":"Na Bangkok dos anos 70, Charles Sobhraj dá uma festa na Casa Kanit. Na sequência, o desaparecimento de dois mochileiros chama a atenção de um diplomata.","air_date":"2021-01-01","runtime":59,"still_path":"https://image.tmdb.org/t/p/original/pg4LVoUmJk1rIamdvFUAcIl4SEV.jpg","vote_average":7.5},"2":{"name":"Episódio 2","overview":"Marie-Andrée Leclerc se apaixona, sem saber direito com quem se meteu. Herman Knippenberg enfrenta dificuldades, mas continua a investigação, arriscando sua carreira.","air_date":"2021-01-03","runtime":59,"still_path":"https://image.tmdb.org/t/p/original/af1kLQlh5UWf0OzSmz9n2HYxV1F.jpg","vote_average":7.8},"3":{"name":"Episódio 3","overview":"As suspeitas aumentam quando Knippenberg encontra a infiltrada. Um francês chega à Casa Kanit em busca de aventura, mas cai numa armadilha e faz uma descoberta chocante.","air_date":"2021-01-10","runtime":58,"still_path":"https://image.tmdb.org/t/p/original/mu0CFPwXvLk2eOnsLGuifs082h8.jpg","vote_average":8},"4":{"name":"Episódio 4","overview":"Charles demonstra seu poder e Marie-Andrée entra no jogo dele. Ajay Chowdhury faz uma viagem. Nadine Gires se infiltra na Casa Kanit. Knippenberg é descoberto pelo chefe.","air_date":"2021-01-17","runtime":58,"still_path":"https://image.tmdb.org/t/p/original/i2og18ZJw5xIjGNHmVo9ETDUh4P.jpg","vote_average":7.9},"5":{"name":"Episódio 5","overview":"Quem é o predador e quem é a presa? Nadine precisa manter a equipe venenosa no ninho na hora da batida. Mas Charles tem outros planos.","air_date":"2021-01-24","runtime":57,"still_path":"https://image.tmdb.org/t/p/original/fncUVpTiszutnPkRUiay8ZK46q2.jpg","vote_average":8},"6":{"name":"Episódio 6","overview":"Charles arma um golpe ousado. Knippenberg, ainda obcecado, tenta esquecer. Marie-Andrée e Ajay brigam porque os dois querem estar ao lado do gênio Charles.","air_date":"2021-01-31","runtime":56,"still_path":"https://image.tmdb.org/t/p/original/rCh2XDvMIrwAShIAC6BtEuN6B80.jpg","vote_average":8},"7":{"name":"Episódio 7","overview":"Charles e Marie-Andrée chegam a Paris com planos brilhantes, mas não são bem recebidos. Para deter a dupla, Knippenberg procura a mídia.","air_date":"2021-02-07","runtime":55,"still_path":"https://image.tmdb.org/t/p/original/pTmMkkgELp33xvijgyXwZ5tLOYH.jpg","vote_average":8},"8":{"name":"Episódio 8","overview":"Na Índia, Charles e Marie-Andrée têm seu pior momento. A caçada mundial pelo casal esquenta, mas Knippenberg não esquece o caso. Quem pagará pelas vidas perdidas?","air_date":"2021-02-14","runtime":59,"still_path":"https://image.tmdb.org/t/p/original/y3bDyXRspoXwT1jOQciXSzHLLWM.jpg","vote_average":8.1}}}}},
