"197460":{"id":"197460","name":"Ourika: Cidade em Chamas","slug":"ourika-cidade-em-chamas","original_title":"Ourika","overview":"Em 2005, num subúrbio francês, uma apreensão de drogas desmantela a rede de uma família de traficantes. Driss, um estudante brilhante, é forçado a assumir os negócios da família, se envolvendo cada vez mais. Diante dele está William, um jovem policial ambicioso e idealista que vai fazer de tudo ao seu alcance para detê-lo. A sua luta incansável irá levá-los dos subúrbios até o vale de Ourika.","first_air_date":"2024-03-28","episode_run_time":52,"vote_average":7,"number_of_seasons":1,"number_of_episodes":7,"created_by":["Booba","Clément Godart"],"production_companies":["Prélude","7Scope"],"genres":["Action & Adventure","Drama"],"certification":"N/A","backdrop_path":"https://image.tmdb.org/t/p/original/rV5wNwckVBkhHq3kXR5raP7T8fA.jpg","poster_path":"https://image.tmdb.org/t/p/original/48XmWHwgVAUYzr1NHjtju8NC7m.jpg","cast":["Adam Bessa","Salim Kéchiouche","Noham Edje","Booba","Slimane Dazi"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/48XmWHwgVAUYzr1NHjtju8NC7m.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/48XmWHwgVAUYzr1NHjtju8NC7m.jpg","air_date":"2024-03-28","episode_count":7,"overview":"N/A","vote_average":7.1,"episodes":{"1":{"name":"Episódio 1","overview":"Num subúrbio de Paris, Moussa Jebli, um traficante de maconha bem-sucedido, vê a sua carga ser apreendida pelas autoridades antidrogas. Toda a família é prejudicada com a queda dele, incluindo o irmão mais novo, Driss, um aluno brilhante que sempre manteve distância dos negócios da família. Do outro lado está William, um jovem policial recém-transferido que descobre as regras do jogo policial.","air_date":"2024-03-28","runtime":45,"still_path":"https://image.tmdb.org/t/p/original/olEVPWx1s4728KXP39XNC8CO7NA.jpg","vote_average":7.5},"2":{"name":"Episódio 2","overview":"A prisão de Moussa enlouquece o subúrbio. William percebe as consequências dos seus atos e tenta se redimir aos olhos dos colegas. Driss se vê ameaçado pelos credores do irmão e recorre a seus amigos de infância para encontrar uma solução. Na prisão, Moussa tem que enfrentar velhos conhecidos.","air_date":"2024-03-28","runtime":55,"still_path":"https://image.tmdb.org/t/p/original/afGOcNzfaaT8nGcFVXmb30r5s8B.jpg","vote_average":7},"3":{"name":"Episódio 3","overview":"William confessa ao colega Taz que foi enganado por seu informante. Eles decidem segui-lo e acabam cruzando Driss no caminho. Obrigado a vender a cocaína roubada no assalto, o jovem estudante começa a traficar em festas parisienses, sob o olhar reprovador da namorada Inès.","air_date":"2024-03-28","runtime":49,"still_path":"https://image.tmdb.org/t/p/original/aCHO1vqURQq9V30bHgcGQ7dSvmK.jpg","vote_average":7},"4":{"name":"Episódio 4","overview":"A família Jebli segue para Marrocos para reconquistar a confiança dos tios, que plantam maconha nas montanhas do Rif. William e Racheton, o chefe do esquadrão antidrogas, estão perseguindo eles. Mas a intriga na política frustra os planos da polícia e dos traficantes.","air_date":"2024-03-28","runtime":50,"still_path":"https://image.tmdb.org/t/p/original/dAQfaqY57hw8reysRxDEy58SC6H.jpg","vote_average":7},"5":{"name":"Episódio 5","overview":"Depois da tragédia na recepção da embaixadora, Racheton e William têm que retornar à França. Desafiando os seus superiores, William permanece em Marrocos para continuar a rastrear a família Jebli. Driss está determinado a se vingar do filho dos Benali e recuperar ele mesmo o controle das terras da família, ignorando seus tios, que não estão satisfeitos com a tomada de poder dele.","air_date":"2024-03-28","runtime":56,"still_path":"https://image.tmdb.org/t/p/original/j34YVlqpz3mGyhBqRI7yDIwxHFt.jpg","vote_average":7},"6":{"name":"Episódio 6","overview":"Graças a uma aliança, Driss e William chegam ao poder em seus respectivos círculos. William brilha no esquadrão antidrogas, fazendo várias apreensões, gerando inveja entre outros policiais. Driss está inundando o mercado com seu produto, enquanto outros traficantes vão caindo um por um. Deixado para trás, Moussa começa a suspeitar da ascensão espetacular de seu irmão.","air_date":"2024-03-28","runtime":50,"still_path":"https://image.tmdb.org/t/p/original/92gn2V0FgwQkE0AKxV88nXmspaR.jpg","vote_average":7},"7":{"name":"Episódio 7","overview":"Driss, cego pela sua sede de vingança, finalmente conseguiu localizar Benali. Mas seguindo a informação de Moussa, a polícia alfandegária invade a casa dele. Racheton e William estão comprometidos e vão fazer de tudo para se protegerem. William deve agora aceitar ter que prender seu antigo aliado.","air_date":"2024-03-28","runtime":51,"still_path":"https://image.tmdb.org/t/p/original/9rTDnqGnDU60NUhGnNfl08jfiQQ.jpg","vote_average":7}}}}},
